      media(type: ANIME, isAdult: false, genre: ${genres}){
        title{
          english
          romaji
        }
        genres
        description
        coverImage{
          medium
          large
          extraLarge
        }
        studios{
          nodes{
            name
          }
        }
      }
    }
  }
  `

export default function GenreQuery(props){
  console.log(props);
